//import logo from './logo.svg';
import React,{useState} from 'react';
import SubmitForm from './submitform';
import DeleteItem from './deleteItem';
import CheckBox from './checkBox';
import Border from './border';
import './App.css'


function App() {
const[shifts,setShifts]=useState([]);
console.log(shifts);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Todolist</h1>
        <SubmitForm setShifts={setShifts}/>
        {
          shifts.map(shift=>{
            return(
             <div>
               <Border>
                <li className='myList'>
                  <CheckBox shift={shift} />
                  <DeleteItem setShifts={setShifts} shift={shift} />
                  <button>Edit</button>
                </li>
               </Border> 
             </div>
            )
          })
        }


        {/* <InitialData /> */}

      </header>
    </div>
  );
}

export default App;
